std::tr1::unordered_map<std::string, KBEngine::thread::ThreadMutex> windows造成诡异的crash
https://github.com/kbengine/kbengine/issues/278

由于unordered_map隐式拷贝构造了KBEngine::thread::ThreadMutex

等于如下代码：
THREAD_MUTEX mutex_, mutex_1;
THREAD_MUTEX_INIT(mutex_);
mutex_1 = mutex_;
THREAD_MUTEX_DELETE(mutex_);
THREAD_MUTEX_DELETE(mutex_1);

做了一个防护：
private:
// 禁止拷贝构造
// 这里不允许拷贝构造mutex_，这是非常危险的
ThreadMutex(const ThreadMutex& v)
{
assert(false);
}

也可以这样, 更好使用
ThreadMutex(const ThreadMutex& v):
ThreadMutex()
{
// 这里不允许拷贝构造mutex_，这是非常危险的
}

